import holberton_logo from './holberton_logo.jpg';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={holberton_logo} className="App-logo" alt="logo" />
        <p>
          School dashboard
        </p>
      </header>
      <body className='App-body'>
        <p>Login to access the full dashboard</p>
      </body>
    </div>
  );
}

export default App;
